import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as e,f as t}from"./app-55008a3b.js";const n={},c=t(`<h1 id="vscode中使用git" tabindex="-1"><a class="header-anchor" href="#vscode中使用git" aria-hidden="true">#</a> VScode中使用Git</h1><p>!!! tip<br> Contents：VScode,Git</p><pre><code>Contributor: YJY

Email:522432938@qq.com

如有错误，请批评指正。
</code></pre><p>本篇介绍在vscode中使用git的方法(以码云为例，githup是同样的操作)</p><h2 id="初始化仓库" tabindex="-1"><a class="header-anchor" href="#初始化仓库" aria-hidden="true">#</a> 初始化仓库</h2><p>如图所示，等价于git init</p><figure><img src="https://img-blog.csdnimg.cn/02c975fb229d43ba9d5496ca38e2f250.png?x-oss-process=image/watermark,type_d3F5LXplbmhlaQ,shadow_50,text_Q1NETiBAamFrZTQ4NA==,size_11,color_FFFFFF,t_70,g_se,x_16" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><h2 id="生成公钥" tabindex="-1"><a class="header-anchor" href="#生成公钥" aria-hidden="true">#</a> 生成公钥</h2><div class="language-powershell line-numbers-mode" data-ext="powershell"><pre class="language-powershell"><code>ssh-keygen <span class="token operator">-</span>t rsa <span class="token operator">-</span>C <span class="token string">&quot;xxxxxx@qq.com&quot;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>一路回车，有y/n则y。在红框中的文件夹中去找公钥文件。</p><figure><img src="https://img-blog.csdnimg.cn/f970f5adca28474f9292bec5ef0a377b.png" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p><strong>id_rsa是私钥，id_rsa.pub是公钥</strong></p><figure><img src="https://img-blog.csdnimg.cn/6df63877a7584b01b129eb5d8c3d86aa.png" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p>使用公钥私钥匹配就可以免去登录验证</p><h2 id="配置公钥" tabindex="-1"><a class="header-anchor" href="#配置公钥" aria-hidden="true">#</a> 配置公钥</h2><p>githup与gitee是同样的方式，将id_rsa.pub的乱码复制到下图的地方。</p><figure><img src="https://img-blog.csdnimg.cn/fa0867d301ee415fa4713a2196e22373.png?x-oss-process=image/watermark,type_d3F5LXplbmhlaQ,shadow_50,text_Q1NETiBAamFrZTQ4NA==,size_20,color_FFFFFF,t_70,g_se,x_16" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><h2 id="vscode中添加远程仓库" tabindex="-1"><a class="header-anchor" href="#vscode中添加远程仓库" aria-hidden="true">#</a> VScode中添加远程仓库</h2><p>首先复制地址，选ssh</p><figure><img src="https://img-blog.csdnimg.cn/e879311fa58e44a8b4873d88bcc487ed.png" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p>添加远程仓库</p><figure><img src="https://img-blog.csdnimg.cn/8fb6995cd9774423a2c2a1c87bc826ee.png?x-oss-process=image/watermark,type_d3F5LXplbmhlaQ,shadow_50,text_Q1NETiBAamFrZTQ4NA==,size_20,color_FFFFFF,t_70,g_se,x_16" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p>在框中输入复制过来的ssh地址，点击从URL添加远程仓库</p><figure><img src="https://img-blog.csdnimg.cn/c7376bf75bcf40bdbcd705aafd0d9993.png" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p>输入仓库名字，指的是在vscode的仓库名字，随意填<br><img src="https://img-blog.csdnimg.cn/f645de8f06614fafa75c0528bca0cdfe.png" alt="在这里插入图片描述" loading="lazy"></p><h2 id="提交与推送" tabindex="-1"><a class="header-anchor" href="#提交与推送" aria-hidden="true">#</a> 提交与推送</h2><p>先暂存更改</p><figure><img src="https://img-blog.csdnimg.cn/139ddf3f7ef24059affae9f673a5cf02.png" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p>在...中可以进行一系列操作，本质上就是有一个图形化的git操作界面，</p><figure><img src="https://img-blog.csdnimg.cn/18ab8c5ec0dd4a898a1dac91be564da5.png?x-oss-process=image/watermark,type_d3F5LXplbmhlaQ,shadow_50,text_Q1NETiBAamFrZTQ4NA==,size_20,color_FFFFFF,t_70,g_se,x_16" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure><p>一般选择拉取自，或推送到</p><figure><img src="https://img-blog.csdnimg.cn/62b0e3debec0446aba41e43444ab3836.png" alt="在这里插入图片描述" tabindex="0" loading="lazy"><figcaption>在这里插入图片描述</figcaption></figure>`,32),s=[c];function g(d,r){return i(),e("div",null,s)}const l=a(n,[["render",g],["__file","vscode_git.html.vue"]]);export{l as default};
